('signup', '1'),
('maintenance', '0'),
('notification', 'Chức năng đăng kí tài khoản hiện tại sẽ là miễn phí, chúc các bạn chơi game vui vẻ! ....'),
('event', '[84,85]'),
('newbaotri', 'Hệ thống thử nghiệm - Chúc các bạn chơi game vui vẻ'),
('ingame', 'Đã tăng cường bản update nhẹ cải tiến lại Trex. Lên FB để cập nhật thông tin nhé!'),
('num_item', '{\"88\":\"100\",\"89\":\"100\"}'),
('add_item', ''),
('admin', '{\"admincp\":\"be3922aa8e113a904e06446dffd20a34\"}'),
('title', 'Army Old - TNTGAME'),
('keywords', 'Mobi army lậuu,army lau, source army, tntgame free, game lau, berus,armylau hack, mobi army 2 lau, mobi army 3 lau, army free xu, army hack, army full xu,kaga, thangberus,thang berus,'),
('description', 'Đăng kí miễn phí'),
('guide', '1. Đăng kí tài khoản\n\nVui lòng đăng kí tài khoản phía trên\n\nQuà đăng ký: 100.000.000 xu và 50.000 lượng\n\n2. Thông Báo\n\nCác bạn tham gia nhóm <a href=\"https://www.facebook.com/groups/750145065170892/\">Cộng Đồng Mobi Army 2 Lậu - TNT GAME</a> trên FB để Cập Nhật tin tức mới nhất, giao lưu trao đổ\n\n3. Cách chơi GAME\n\nCác bạn đăng kí xong vui lòng đăng nhập vào web để tạo tài khoản nhé!\nTự động mở x2 từ khung giờ 7h tối tới 11h tối, anh tranh thủ nhé\nHiện tại vẫn còn lỗi mặc BẠC sẽ bị tàng hình, anh em cẩn thận.\nLỗi không đăng nhập được vào game (-100) tài khoản của các bạn đang có số lượng XU trên 2.000.000.000. Vui lòng đăng nhập vào web và FIX XU nhé\n\n4. Chat thế giới:\nVào game bấm vào bạn bè sẽ có người tên là kenhthegioi các bạn sms với họ là sẽ chat thế giới, giá là 500.000 XU / lần\n\n5. Ra mắt chức năng chuyển XU bằng tin nhắn trong game.\nBước 1: Các bạn kết bạn với người muốn chuyển.\nBước 2; Chat với họ: chuyenxu dấu cách (số XU)\nBước 3: Bị admin trừ phí 25% =))\n\n6: Hỗ trợ Army Old\n\nMọi thắc mắc cứ liên hệ  <a href=\"https://www.facebook.com/groups/750145065170892/\">Từ Ngọc Trai</a>'),
